import React from "react";

export default function About() {
  return (
    <section id="about">
      <h2>About Me</h2>
      <img
        src="/profile.jpg"   // ✅ Fixed here — no import needed
        alt="Profile"
        style={{ width: "150px", borderRadius: "50%", marginTop: "20px" }}
      />
      <p>
        Hi, I'm <strong>Your Name</strong>. I'm a passionate Full Stack Developer who
        loves building web applications and exploring new technologies.
      </p>
    </section>
  );
}
